import styles from './Header.module.css';


const Header=()=>{
    return (
      <>
      <div className={styles.header}>
        <h2>
            ReactMeals
        </h2>
        <button>Your cart</button>
      </div> 
      <image src='C:\Users\nikol\Documents\React\Practice_Food_Order_App_Project\src\Header\meals.jpg'/> 
      </>
    )
}

export default Header;
